import React from 'react';
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'

export default class Interests extends React.Component {
    state = {
        page: 0
    }


    render() {
        return (

            <div>

                {/* <h1>Interests</h1> */}

                {/* <ul>
                    <li>Sci-fi</li>
                    <li>Garageband / music making</li>
                    <li>Photography</li>
                    <li>Reading</li>
                </ul> */}

                <Parallax className = 'Parallax' ref={ref => (this.parallax = ref)} pages={2} style = {{ 'backgroundColor': 'red' , 'height': '90vh' }}>
                    <ParallaxLayer className = 'Title' speed={1} offset={0} factor = {.3} style = {{ 'backgroundColor': 'red' , 'height': '100px' , 'width': '50%' }}>
                        <div>
                            <h1>Interests</h1>
                        </div>
                    </ParallaxLayer>

                    <ParallaxLayer className = 'Title' speed={1} offset={1} factor = {.3}>
                        <div>
                            <h1>SCI FI</h1>
                        </div>
                    </ParallaxLayer>
                </Parallax>

            </div>

        )
    }

}
